import React from 'react';
import '../App.css';
import { Button } from './Button';
import './Landing.css';

function Landing() {
    return (
        <div className='landing-container'>
            <h1> Professional Advice </h1>
            <div className="landing-btn">
                <Button
                    className='btn'
                    variant='contained' 
                    color='primary'
                >
                GET STARTED
                </Button>
            </div>

        </div>
    )
}

export default Landing
